import React from "react";
import Navbar from "./components/Navbar";
import Card from "./components/Card";
import Search from "./components/Search"; // Asegúrate de utilizar el nombre correcto

const App = () => {
  return (
    <div>
      <header>
        <Navbar />
        <Search />
      </header>
      <main>
        <Card />
      </main>
    </div>
  );
};

export default App;
